/*Table structure for table `comments` */

DROP TABLE IF EXISTS `comments`;

CREATE TABLE `comments` (
  `sno` int(233) DEFAULT NULL,
  `id` int(233) DEFAULT NULL,
  `uname` varchar(233) DEFAULT NULL,
  `comments` varchar(233) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `comments` */

/*Table structure for table `conflict` */

DROP TABLE IF EXISTS `conflict`;

CREATE TABLE `conflict` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `from_Name` varchar(100) DEFAULT NULL,
  `uname` varchar(100) DEFAULT NULL,
  `message` text,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;

/*Data for the table `conflict` */

insert  into `conflict`(`id`,`from_Name`,`uname`,`message`) values (1,'dinesh','ruby','Hi'),(2,'ruby','dinesh','Hi'),(3,'david','dinesh','Hai how are you'),(4,'kumar','john','Hi John How are you. now i am not friends for you.. '),(5,'john','kumar','Hi kumar how are you..\r\nk i will give friend request for u');

/*Table structure for table `fil` */

DROP TABLE IF EXISTS `fil`;

CREATE TABLE `fil` (
  `id` int(200) NOT NULL AUTO_INCREMENT,
  `category` varchar(200) DEFAULT NULL,
  `word` varchar(200) DEFAULT NULL,
  KEY `id` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

