/*Table structure for table `friends` */

DROP TABLE IF EXISTS `friends`;

CREATE TABLE `friends` (
  `sno` int(233) NOT NULL AUTO_INCREMENT,
  `uname` varchar(233) DEFAULT NULL,
  `friends` varchar(233) DEFAULT NULL,
  `status` varchar(233) DEFAULT 'Not A Realtion',
  `gift` varchar(900) DEFAULT NULL,
  `msg` varchar(233) DEFAULT NULL,
  `nstatus` varchar(233) DEFAULT 'Not Recevied',
  `sta` varchar(233) DEFAULT 'All',
  PRIMARY KEY (`sno`)
) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=latin1;

