  `uname` varchar(233) DEFAULT NULL,
  `sendto` varchar(233) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `request` */

insert  into `request`(`uname`,`sendto`) values ('dinesh','arun'),('dinesh','durga'),('dinesh','denisha'),('dinesh','shyam'),('dinesh','yuvaraj'),('dinesh','pavithra'),('dinesh','soumya'),('dinesh','renuga'),('dinesh','kaviya'),('dinesh','tawfeeq'),('dinesh','tawfeeq'),('dinesh','saravanan'),('dinesh','udaya');

/*Table structure for table `sendto` */

DROP TABLE IF EXISTS `sendto`;

CREATE TABLE `sendto` (
  `Send` varchar(100) DEFAULT NULL,
  `Receiver` varchar(100) DEFAULT NULL,
  `email` varchar(100) DEFAULT NULL,
  `product` varchar(100) DEFAULT NULL,
  `price` varchar(1000) DEFAULT NULL,
  `image` varchar(100) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

